import icons from "./icon";

const {
  MdOutlineLibraryMusic,
  RiDonutChartLine,
  FcLineChart,
  PiMusicNotesPlus,
  MdOutlineCategory,
} = icons;
export const sidbarMenu = [
  {
    path: "my-music",
    test: "Thư Viện",
    icons: <MdOutlineLibraryMusic />,
  },
  {
    path: "",
    test: "Khám phá",
    icons: <MdOutlineLibraryMusic />,
  },
  {
    path: "zing-chart",
    test: "#zingchart",
    icons: <FcLineChart />,
  },
  {
    path: "moi-phat-hanh",
    test: "BXH Nhạc Mới",
    icons: <MdOutlineLibraryMusic />,
  },
  {
    path: "hub",
    test: "Chủ Đề & Thể Loại",
    icons: <MdOutlineCategory />,
  },
  {
    path: "top100",
    test: "Top 100",
    icons: <MdOutlineLibraryMusic />,
  },
];

export default sidbarMenu;
